  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chincoteague
  National Wildlife Refuge outlines Refuge accomplishments during the 1980 calendar
  year. The report begins with an introduction to the Refuge and information about
  weather conditions, habitat conditions, and the system status. Construction, maintenance,
  and wildfires are also described. Habitat management is covered; croplands, grasslands,
  wetlands, forests, and wilderness areas are discussed. The wildlife section of the
  report discusses endangered species, threatened species, migratory birds, mammals,
  and non-migratory birds. Interpretation and recreation activities are outlined;
  topics include fishing, hunting, and law enforcement. Field investigations, cooperative
  programs, items of interest, and safety information are attached\",\n\t\"owner_org\":
